import React from "react";
import "./PoolStats.css";
import nano from "./nano.png";
import eth from "./eth.png";

export default class Lend extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      seconds: 20,
      minutes: 23,
      hours: 5,
      days: 1,
    };
  }

  render() {
    return (
      <div className="both">
        <div className="container">
          <div className="container2" id="timeemojidiv">
            <h1 id="timeemoji">
              {" "}
              <img id="nano" src={nano} />
              <img id="eth" src={eth} />
            </h1>
          </div>
          <p>Nano to Etherum</p>
          <div className="flexbox">
            <p>Destination</p>
            <input></input>
            <tr>
              <td className="flexboxtext">seconds</td>
              <td className="flexboxtext">minutes</td>
              <td className="flexboxtext">hours</td>
              <td className="flexboxtext">days</td>
            </tr>
          </div>
        </div>
        <div className="container">
          <div className="container2" id="timeemojidiv">
            <h1 id="timeemoji">
              <img id="nano" src={nano} />
              <img id="eth" src={eth} />
            </h1>
          </div>
          <div className="flexbox">
            <p>Destination</p>
            <input></input>
            <tr>
              <td className="flexboxtext">seconds</td>
              <td className="flexboxtext">minutes</td>
              <td className="flexboxtext">hours</td>
              <td className="flexboxtext">days</td>
            </tr>
          </div>
        </div>
      </div>
    );
  }
}
